import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { getNoteById, updateNote } from '../../services/notesService';

const MinuteNoteDetail = () => {
  const { id } = useParams();
  const [note, setNote] = useState(null);
  const [users, setUsers] = useState([]);
  const [attendees, setAttendees] = useState([]);
  const [markAll, setMarkAll] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchNoteAndUsers = async () => {
      try {
        const noteResponse = await getNoteById(id);
        setNote(noteResponse.data);

        // Fetch users for the checklist
        const userResponse = await fetch('https://dummyjson.com/users');
        const userData = await userResponse.json();
        setUsers(userData.users);

        // Pre-populate attendees if available in the note
        if (noteResponse.data.attendees) {
          setAttendees(noteResponse.data.attendees);
        }
      } catch (err) {
        console.error('Error fetching note or users:', err);
      }
    };

    fetchNoteAndUsers();
  }, [id]);

  const handleAttendeeChange = (userId) => {
    setAttendees((prev) =>
      prev.includes(userId)
        ? prev.filter((id) => id !== userId)
        : [...prev, userId]
    );
  };

  const handleMarkAll = () => {
    if (markAll) {
      setAttendees([]);  // Uncheck all
    } else {
      setAttendees(users.map((user) => user.id));  // Check all
    }
    setMarkAll(!markAll);
  };

  const handleSubmitForApproval = async () => {
    try {
      await updateNote(id, { attendees });
      alert('Note updated with attendees!');
    } catch (err) {
      console.error('Error submitting note:', err);
    }
  };

  const handleEdit = () => {
    navigate(`/minute_note_edit/${id}`);
  };

  if (!note || users.length === 0) {
    return <div>Loading...</div>;
  }

  return (
    <div style={{ padding: '20px', fontFamily: 'Segoe UI, sans-serif' }}>
      <h1 style={{ fontStyle: 'italic', fontWeight: 'normal' }}>{note.title}</h1>

      <p
        style={{
          backgroundColor: '#e0ecff',
          padding: '20px',
          borderRadius: '10px',
          fontStyle: 'italic',
          minWidth: '400px',
          minHeight: '100px',
          width: 'fit-content',
          maxWidth: '600px',
          marginBottom: '20px',
        }}
      >
        {note.content}
      </p>

      <h3 style={{ marginTop: '20px' }}>Attendees:</h3>
      <div style={{ marginTop: '10px', marginBottom: '10px' }}>
        <label>
          <input
            type="checkbox"
            checked={markAll}
            onChange={handleMarkAll}
            style={{ marginRight: '8px' }}
          />
          Mark All
        </label>
      </div>

      <ul style={{ listStyleType: 'none', paddingLeft: '0' }}>
        {users.map((user) => (
          <li key={user.id} style={{ marginBottom: '10px' }}>
            <label style={{ fontStyle: 'italic' }}>
              <input
                type="checkbox"
                value={user.id}
                checked={attendees.includes(user.id)}
                onChange={() => handleAttendeeChange(user.id)}
                style={{ marginRight: '10px' }}
              />
              {user.firstName} {user.lastName}
            </label>
          </li>
        ))}
      </ul>

      <div style={{ marginTop: '20px', display: 'flex', gap: '10px' }}>
        <button
          onClick={handleEdit}
          style={{
            backgroundColor: '#d9d9d9',
            border: 'none',
            borderRadius: '10px',
            padding: '6px 12px',
            cursor: 'pointer',
          }}
        >
          Edit
        </button>

        <button
          onClick={handleSubmitForApproval}
          style={{
            backgroundColor: '#b4d8f7',
            border: 'none',
            borderRadius: '10px',
            padding: '6px 12px',
            cursor: 'pointer',
          }}
        >
          Send for Approval
        </button>
      </div>
    </div>
  );
};

export default MinuteNoteDetail;
